import React from 'react'
import '../assets/components/ExperienciaContainer.scss'

const ExperienciaContainer = ({children}) => {
    return (
        <section id='experiencia' className='experienciaContainer'>
            {children}
        </section>
    )
}

export default ExperienciaContainer
